"فێرکاری: 
--------------
-تکایە دوگمەی \"پاراستن\" دابگرە;
-ڕێگە بە تێپەڕبوونی زانیاری بدە لەڕێگەی وای-فای یاخود ئەنتەرنێتی هاندەکەت وە ڕێگە بە هەموو پەیوەست بوونەکان بدە بۆ بەرنامە;
-شێوازێک هەڵبژێرەو دوگمەی \"پینە\" دابگرە ،؛
-\"دەسپێبکە\" وە ئاگاداربە لە دۆخی مۆڵەت پێدانەکە(تازەکردنەوە بکە گەر پێویستبوو);
-ئەگەر ئەم شێوازە هارمەتیدەر نەبوو، دوگمەی \"گێڕانەوە\" دابگرەو وە هەوڵبدەرەوە لەگەڵ شێوازێکی کە.
 ئەگەر کردارەکە سەرکەوتووبوو ئەوا دوگمەی گۆڕانکاریەکان چاکبکە دابگرە"
